contract DepositAndWithdraw {
    address payable public accountWithDeposit;
    uint public contractBalance; // New state variable to store the contract's balance

    constructor() public {
        accountWithDeposit = msg.sender; // Set the deployer's address as the default account with deposit
        contractBalance = 0;
    }

    function deposit() public payable {
        require(msg.sender == accountWithDeposit, "Only the account with deposit can make deposits");
        require(msg.value > 0, "Deposit amount must be greater than 0");

        contractBalance += msg.value; // Update contract balance
    }

    function withdraw() public {
        require(msg.sender == accountWithDeposit, "Only the account with deposit can withdraw");
        require(contractBalance > 0, "No deposit available to withdraw");

        uint amountToWithdraw = contractBalance;
        contractBalance = 0; // Reset the contract balance after withdrawal
        accountWithDeposit.transfer(amountToWithdraw);
    }

    // Getter function to retrieve the contract's balance
    function getContractBalance() public view returns (uint) {
        return contractBalance;
    }
}
